owsers into buyers, increasing average order value, and expanding your customer base.'=>'Affirmovi prilagođeni programi Kupi sada plati kasnije uklanjaju cijenu kao prepreku, pretvarajući preglednike u kupce, povećavajući prosječnu vrijednost narudžbe i proširujući bazu kupaca.','Enable PayU\'s exclusive plugin for WooCommerce to start accepting payments in 100+ payment methods available in India including credit cards, debit cards, UPI, & more!'=>'Omogućite PayU-ov ekskluzivni dodatak za WooCommerce kako biste počeli prihvaćati plaćanja u 100+ načina plaćanja dostupnih u Indiji, uključujući kreditne kartice, debitne kartice, UPI i još mnogo toga!','Payoneer Checkout is the next generation of payment processing platforms, giving merchants around the world the solutions and direction they need to succeed in today\'s hyper-competitive global market.'=>'Payoneer Checkout je sljedeća generacija platformi za obradu plaćanja, koja trgovcima diljem svijeta daje rješenja i smjer koji su im potrebni za uspjeh na današnjem hiperkonkurentnom globalnom tržištu.','Credit/debit cards, Apple Pay, Google Pay, and more.'=>'Kreditne/debitne kartice, Apple Pay, Google Pay i još mnogo toga.','Viva.com Smart Checkout'=>'Viva.com Smart Checkout','A European payments solution that allows you to accept payments in over 25 countries and multiple currencies.'=>'Europsko rješenje za plaćanje koje vam omogućuje prihvaćanje plaćanja u 25 zemalja i više valuta.','Paymob'=>'Paymob','PayPal Payments lets you offer PayPal, Venmo (US only), Pay Later options and more.'=>'PayPal Payments omogućuje vam da ponudite PayPal, Venmo (samo SAD), Pay Later opcije i još mnogo toga.','Paymob is a leading payment gateway in the Middle East and Africa. Accept payments online and in-store with Paymob.'=>'Paymob je vodeći pristupnik za plaćanje na Bliskom istoku i u Africi. Prihvaćajte plaćanja putem interneta i u trgovini uz Paymob.','Safe and secure payments using your customer\'s PayPal account.'=>'Sigurna i sigurna plaćanja pomoću PayPal računa vašeg kupca.','The Payfast extension for WooCommerce enables you to accept payments by Credit Card and EFT via one of South Africa\'s most popular payment gateways. No setup fees or monthly subscription costs. Selecting this extension will configure your store to use South African rands as the selected currency.'=>'Proširenje Payfast za WooCommerce omogućuje vam prihvaćanje plaćanja kreditnom karticom i EFT-om putem jednog od najpopularnijih pristupnika plaćanja u Južnoj Africi. Bez naknada za postavljanje ili mjesečnih troškova pretplate. Odabirom ovog proširenja vaša će trgovina konfigurirati da koristi južnoafričke randove kao odabranu valutu.','Antom'=>'Antom','The URL of the image.'=>'URL slike','A suggestion with full details.'=>'Prijedlog sa svim detaljima.','Context ID in which the incentive was dismissed.'=>'ID konteksta u kojem je poticaj odbačen.','The URL of the icon (square aspect ratio).'=>'URL ikone (kvadratni omjer slike).','The URL to dismiss the incentive.'=>'URL za odbacivanje poticaja.','The URL to hide the suggestion.'=>'URL za skrivanje prijedloga.','The URL to the terms and conditions for the incentive.'=>'URL uvjeta i odredbi za poticaj.','The badge label for the incentive.'=>'Oznaka značke za poticaj.','The call to action label for the incentive.'=>'Oznaka poziva na akciju za poticaj.','The category of the suggestion.'=>'Kategorija prijedloga.','The description of the suggestion.'=>'Opis prijedloga.','The incentive description. It can contain stylistic HTML.'=>'Opis poticaja. Može sadržavati stilski HTML.','The incentive promo ID. This ID need to be fed into the onboarding flow.'=>'ID promocije poticaja. Ovaj ID treba unijeti u tijek uključivanja.','The incentive title. It can contain stylistic HTML.'=>'Naslov poticaja. Može sadržavati stilski HTML.','The link to dismiss the incentive.'=>'Poveznica za odbacivanje poticaja.','The link to hide the suggestion.'=>'Poveznica za skrivanje prijedloga.','The priority of the suggestion.'=>'Prioritet prijedloga.','The short description of the incentive. It can contain stylistic HTML.'=>'Kratak opis poticaja. Može sadržavati stilski HTML.','The tags associated with the suggestion.'=>'Oznake povezane s prijedlogom.','The title of the suggestion.'=>'Naslov prijedloga.','The type of the suggestion.'=>'Vrsta prijedloga.','The unique identifier for the suggestion.'=>'Jedinstveni identifikator prijedloga.','Your trusted payments partner in Asia and around the world.'=>'Vaš pouzdani partner za plaćanje u Aziji i diljem svijeta.','Links for the provider.'=>'Poveznice za pružatelja usluga.','The URL of the link.'=>'URL veze.','The URL of the provider icon (square aspect ratio - 72px by 72px).'=>'URL ikone davatelja usluga (kvadratni omjer slike - 72 x 72 piksela).','The URL of the provider image.'=>'URL slike davatelja usluga.','The general state of the provider with regards to it\'s payments processing.'=>'Opće stanje pružatelja usluga s obzirom na obradu plaćanja.','The plugin main file. This is a relative path to the plugins directory.'=>'Glavna datoteka dodatka. Ovo je relativni put do direktorija dodataka.','The status of the plugin.'=>'Status dodatka.','The type of the link.'=>'Vrsta veze.','Whether the provider has a payments processing account connected.'=>'Ima li pružatelj usluga povezan račun za obradu plaćanja.','Whether the provider is enabled for use on checkout.'=>'Je li davatelj usluga omogućen za korištenje prilikom naplate.','Tag associated with the provider.'=>'Oznaka povezana s davateljem usluga.','The URL of the payment method icon or a base64-encoded SVG image.'=>'URL ikone načina plaćanja ili SVG slike kodirane base64.','The active incentive for the provider.'=>'Aktivni poticaj za pružatelja usluga.','The description of the payment method. It can contain basic HTML.'=>'Opis načina plaćanja. Može sadržavati osnovni HTML.','The incentive unique ID. This ID needs to be used for incentive dismissals.'=>'Jedinstveni ID 