ped'=>'Šaljite svoje proizvode','Launch your store'=>'Pokrenite svoju trgovinu','Original price was: %s.'=>'Izvorna cijena bila je: %s.','Checkout can be customized <a href="%s">in the Editor</a> with your active theme.'=>'Naplata se može prilagoditi <a href="%s">u uređivaču</a> s vašom aktivnom temom.','⚠️ WooCommerce attempted to install <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>, but the installation failed (see error details in <a href="%4$s">the WooCommerce logs</a>). Please install and activate the plugin manually. <a href="%5$s">More information</a>'=>'⚠️ WooCommerce je pokušao instalirati <a href="%1$s">dodatak Legacy REST API</a> jer je na ovoj stranici <a href="%2$s">omogućen Legacy REST API</a> ili su <a href="%3$s">definirani naslijeđeni webhookovi</a>, ali instalacija nije uspjela (pogledajte pojedinosti o pogrešci u <a href="%4$s">zapisnicima WooCommercea</a>). Instalirajte i aktivirajte dodatak ručno. <a href="%5$s">Više informacija</a>','ℹ️ WooCommerce installed and activated <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>. <a href="%4$s">More information</a>'=>'i️ WooCommerce je instalirao i <a href="%1$s">aktivirao dodatak Legacy REST API</a> jer ova stranica ima <a href="%2$s">omogućen Legacy REST API</a> ili ima <a href="%3$s">definirane naslijeđene webhookove</a>. <a href="%4$s">Više informacija</a>','WooCommerce installed the Legacy REST API plugin but failed to activate it, see context for more details.'=>'WooCommerce je instalirao dodatak Legacy REST API, ali ga nije uspio aktivirati, pogledajte kontekst za više detalja.','⚠️ WooCommerce installed <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a