d support included in your WooCommerce.com subscriptions. Alternatively, you can <a href="%2$s">download</a> and install it manually.'=>'<a href="%1$s">Instalirajte WooCommerce.com Update Manager</a> da biste nastavili primati ažuriranja i pojednostavljenu podršku uključenu u vaše pretplate na WooCommerce.com. Alternativno, možete <a href="%2$s">ga preuzeti</a> i instalirati ručno.','Please <a href="%1$s">activate the WooCommerce.com Update Manager</a> to continue receiving the updates and streamlined support included in your WooCommerce.com subscriptions.'=>'<a href="%1$s">Aktivirajte upravitelj ažuriranja WooCommerce.com</a> da biste nastavili primati ažuriranja i pojednostavljenu podršku uključene u vaše pretplate na WooCommerce.com.',' Activate WooCommerce.com Update Manager to update.'=>' Aktivirajte WooCommerce.com Update Manager za ažuriranje.',' <a href="%1$s">Install WooCommerce.com Update Manager</a> to update.'=>' <a href="%1$s">Instalirajte WooCommerce.com Update Manager</a> za ažuriranje.','block descriptionA text-area field for use in the product editor.'=>'Polje tekstnog područja za upotrebu u uređivaču proizvoda.','block descriptionThe product subsection description.'=>'Opis pododjeljka proizvoda.','block keywordrich-text'=>'obogaćeni tekst','block keywordtextarea'=>'textarea','block titleProduct subsection description'=>'Opis pododjeljka proizvoda','block titleProduct textarea block'=>'Blok tekstnog područja proizvoda','block keywordsubsection'=>'pododjeljak','AID'=>'POMOĆ','Account Type'=>'Vrsta računa','Amount Paid'=>'Ukupan uplaćeni iznos','Application Name'=>'Naziv aplikacije','Background process for coupon meta conversion already started, nothing done.'=>'Pozadinski proces za meta konverziju kupona već je započeo, ništa nije učinjeno.','Background process for coupon meta conversion not started, nothing done.'=>'Pozadinski proces za meta konverziju kupona nije započeo, ništa nije učinjeno.','Background process for coupon meta conversion s