t. <a href="%1$s">See this guide</a> for more details.'=>'Ako je metoda preuzimanja "Prislino preuzimanje" ili "X-Accel-Redirect/X-Sendfile" odabrana, ali ne radi, sustav će koristiti metodu "Preusmjeravanje" kao posljednje sredstvo. <a href="%1$s">Pogledajte ovaj vodič</a> za više pojedinosti.','Allow using redirect mode (insecure) as a last resort'=>'Dopusti korištenje načina preusmjeravanja (nesiguran) kao zadnjeg rješenja','Set your store location and where you\'ll ship to.'=>'Postavite lokaciju svoje trgovine i mjesto na koje ćete slati.','Choose payment providers and enable payment methods at checkout.'=>'Odaberite pružatelje usluga plaćanja i omogućite načine plaćanja na blagajni.','You\'re only one step away from getting paid. Verify your business details to start managing transactions with WooPayments.'=>'Samo ste jedan korak do isplate. Potvrdite svoje poslovne podatke kako biste počeli upravljati transakcijama s WooPayments.','Start by adding the first product to your store. You can add your products manually, via CSV, or import them from another service.'=>'Započnite dodavanjem prvog proizvoda u svoju trgovinu. Svoje proizvode možete dodati ručno, putem CSV-a ili ih uvesti s druge usluge.','Your store address is required to set the origin country for shipping, currencies, and payment options.'=>'Adresa vaše trgovine potrebna je za postavljanje zemlje podrijetla za dostavu, valute i opcije plaćanja.','Set your store location and configure tax rate settings.'=>'Postavite lokaciju svoje trgovine i konfigurirajte postavke porezne stope.','Grow your store'=>'Razvijte svoju trgovinu','The rate at which tax is applied.'=>'Stopa po kojoj se primjenjuje porez.','Notes are unavailable because the "admin-note" data store cannot be loaded.'=>'Bilješke nisu dostupne jer se pohrana podataka "admin-note" ne može učitati.','Store downtime means lost sales. One-click restores get you back online quickly if something goes wrong.'=>'Zastoj trgovine znači gubitak prodaje. Vraćanja jednim klikom brzo vas vraćaju na mrežu ako nešto pođe po zlu.','Protect your WooCommerce Store with Jetpack Backup.'=>'Zaštitite svoju WooCommerce trgovinu uz Jetpack Backup.','Get backups'=>'Nabavite sigurnosne kopije','Mollie'=>'Mollie','The Payfast extension for WooCommerce enables you to accept payments by Credit Card and EFT via one of South Africa’s most popular payment gateways. No setup fees or monthly subscription costs. Selecting this extension will configure your store to use South African rands as the selected currency.'=>'Ekstenzija PayFast za WooCommerce omogućuje vam prihvaćanje plaćanja kreditnom karticom i EFT-om putem jednog od najpopularnijih pristupnika plaćanja u Južnoj Africi. Nema naknada za postavljanje ili mjesečnih troškova pretplate. Odabirom ove ekstenzije konfigurirat ćete svoju trgovinu za korištenje južnoafričkih randa kao odabrane valute.','Change status to cancelled'=>'Promjeni status u "Otkazano"','Number of variation items sold.'=>'Broj prodanih varijacija artikala.','Variations Sold'=>'Prodane varijacije artikala','Number of product items sold.'=>'Broj prodanih stavki proizvoda.','Products sold'=>'Prodani proizvodi','Source of note.'=>'Izvor bilješke.','Data store:'=>'Pohranjivanje podataka:','This section shows details of Action Scheduler.'=>'Ovaj odjeljak prikazuje detalje o Action Scheduler.','Products by Rating list'=>'Proizvodi prema popisu ocjena','Recently Viewed Products list'=>'Popis nedavno pregledanih proizvoda','Download %d ID'=>'Preuzimanje %d ID','Things to do next'=>'Sljedeći zadaci','Manage transactions without leaving your WordPress Dashboard. Only with WooPayments.'=>'Upravljajte transakcijama bez napuštanja WordPress nadzorne ploče. Samo uz WooPayments.','Product Link'=>'Poveznica na proizvod','A link to a product.'=>'Poveznica na proizvod. ','A link to a product category.'=>'Poveznica na kategoriju proizvoda. ','Product Category Link'=>'Poveznica kategorije proizvoda ','Create and send purchase follow-