roducts based on a maximum price, provided using the smallest unit of the currency.'=>'Ograniči grupu rezultata na proizvode temeljene na maksimalnoj cijeni, pod uvjetom da se koristi najmanja jedinica valute.','Limit result set to products based on a minimum price, provided using the smallest unit of the currency.'=>'Ograniči grupu rezultata na proizvode temeljene na minimalnoj cijeni, pod uvjetom da se koristi najmanja jedinica valute.','The %s payment gateway is not available.'=>'Payment gateway %s nije dostupan.','Clear template cache'=>'Očisti predmemoriju predložaka','This tool will empty the template cache.'=>'Ovaj alat će očistiti predmemoriju predložaka.','Verify base database tables'=>'Verificiraj tablice baze podataka','Verify if all base database tables are present.'=>'Provjera jesu li sve osnovne tablice baze podataka prisutne.','Verify database'=>'Verificiraj bazu podataka','First order received'=>'Primljena je prva narudžba','Collect and validate EU VAT numbers at checkout'=>'Skupite i provjerite EU VAT brojeve na checkoutu','If your store is based in the EU, we recommend using the EU VAT Number extension in addition to automated taxes. It provides your checkout with a field to collect and validate a customer\'s EU VAT number, if they have one.'=>'Ako je vaša trgovina locirana u EU, preporučujemo korištenje EU VAT Number ekstenzije uz automatske poreze. U checkoutu ponuditi će polje za upis i provjeru kupčevog EU VAT broja, ako ga ima.','Get real-time order alerts anywhere'=>'Dobijte obavijesti o narudžbama u realnom vremenu svugdje.','Get notifications about store activity, including new orders and product reviews directly on your mobile devices with the Woo app.'=>'Dobijte obavijesti o aktivnostima trgovine, uključujući nove narudžbe i recenzije proizvoda direktno na vaše mobilne uređaje s Woo aplikacijom.','Maximum number of items to be returned in result set. Defaults to no limit if left blank.'=>'Maksimalni broj artikala koji se vraćaju u grupi rezultata. Ako je prazno korisit se izvorno neograničeno.','Invalid category ID.'=>'Nevažeći ID kategorije.','WooCommerce %1$s table creation failed. Does the %2$s user have CREATE privileges on the %3$s database?'=>'Kreiranje WooCommerce tablice %1$s nije uspjelo. Ima li korisnik %2$s KREIRAJ povlastice u bazi podataka %3$s?','Verifying database... One or more tables are still missing: '=>'Provjera baze podataka ... Još uvijek nedostaju jedna ili više tablica:','Database verified successfully.'=>'Baza podataka uspješno je provjerena.','You need WooCommerce 4.2 or newer to run this tool.'=>'Za pokretanje ovog alata potreban vam je WooCommerce 4.2 ili noviji.','The active version of WooCommerce does not support template cache clearing.'=>'Aktivna inačica WooCommercea ne podržava brisanje predmemorije predloška.','Template cache cleared.'=>'Predmemorija predloška obrisana.','The admin note layout has a wrong prop value.'=>'Admin izgled bilješki ima pogrešnu prop vrijednost.','Starting a fashion website is exciting but it may seem overwhelming as well. In this article, we\'ll walk you through the setup process, teach you to create successful product listings, and show you how to market to your ideal audience.'=>'Pokretanje modne web-stranice je uzbudljivo ali može se činiti nadmoćno neodoljiv. U ovom članku provesti ćemo vas kroz proces postavljanjam naučiti vas kako napraviti uspješne liste proizvoda, i pokazati kako se marketinški promovirati pred vašim idealnim kupcima.','Start your online clothing store'=>'Započnite online trgovinu s odjećom','This video tutorial will help you go through the process of adding your first product in WooCommerce.'=>'Ovaj video tutorijal pomoći će vam u procesu dodavanja vašeg prvog proizvoda u WooCommerce.','Do you need help with adding your first product?'=>'Trebate li pomoć s dodavanjem vašeg prvog proizvoda?','Now that you’ve chosen us as a partner, our goal is to make sure we\'re providing the right tools to meet your needs. We\'re looking forward to having your feedback on the store setup experience so we can improve it in the future.'=>'Sad kada ste nas odabrali kao partnera, naš cilj je pobrinuti se da vam pružamo ispravne alate koji ispunjavaju vaše potrebe. Veselimo se vašim povratnim informacijama o iskustvu postavljanja trgovine kako bi ga poboljšali u budućnosti.','Share feedback'=>'Podijeli povratne informacije','Watch tutorial'=>'Pogledaj tutorijal','Changing eCommerce platforms might seem like a big hurdle to overcome, but it is easier than you might think to move your products, customers, and orders to WooCommerce. This article will help you with going through this process.'=>'Mijenjanje eCommerce platforme može se činiti kao velika prepreka, ali je lakše nego što mislite preseliti vaše proizvode, kupce i narudžbe u WooCommerce. Ovaj članak pomoći će vam u tom procesu.','Do you want to migrate from Shopify to WooCommerce?'=>'Želite li migrirati s Shopify u WooCommerce?','WooCommerce Subscriptions allows you to introduce a variety of subscriptions for physical or virtual products and services. Create product-of-the-month clubs, weekly service subscriptions or even yearly software billing packages. Add sign-up fees, offer free trials, or set expiration periods.'=>'WooCommerce Subscriptions omogućuju vam da ponudite brojne pretplate za fizičke ili virtualne proizvode i usluge. Kreirajte proizvod-mjeseca klubove, pretplate za tjedne usluge ili čak pakete za godišnju naplatu softvera. Dodajte naknadu za upis, ponudite besplatne periode, ili postavite ograničene vremenske periode.','Features'=>'Značajke','Do you need more info about WooCommerce Subscriptions?'=>'Trebate li više informacija o WooCommerce Subscriptions?','Views'=>'Pregledi','Visitors'=>'Posjetitelji','Registers whether the note is deleted or not'=>'Registrira je li bilješka obrisana ili nije.','The image of the note, if any.'=>'Slika bilješke, ako postoji.','The layout of the note (e.g. banner, thumbnail, plain).'=>'Izgle