antages of having the plugins connected to your store! Sorry for the inconvenience. The "Jetpack" and "WooCommerce Shipping & Tax" plugins will be installed & activated for free.'=>'Primijećena je greška prilikom instalacije Jetpack i WooCommerce Shipping & Tax. Molimo pokušajte kasnije i uživajte u prednostima dodataka spojenih na vašu trgovinu! Ispričavamo se na neugodnosti. "Jetpack" i "WooCommerce Shipping & Tax" dodaci će biti instalirani i aktivirani besplatno.','User&#8217;s WooCommerce access to purchased downloads data.'=>'Pristup kupljenim preuzetim podacima korisnika&#8217; WooCommerce-a.','User&#8217;s WooCommerce payment tokens data.'=>'Podaci o tokenima za plaćanje korisnika&#8217; s WooCommerce-a.','Zambézia'=>'Zambézia','Tete'=>'Tete','Sofala'=>'Sofala','Niassa'=>'Niassa','Nampula'=>'Nampula','Maputo'=>'Maputo','Maputo Province'=>'Maputo provincija','Manica'=>'Manica','Inhambane'=>'Inhambane','Gaza'=>'Gaza','Cabo Delgado'=>'Cabo Delgado','Western North'=>'Western North','Volta'=>'Volta','Upper West'=>'Upper West','Upper East'=>'Upper East','Savannah'=>'Savannah','Oti'=>'Oti','North East'=>'North East','Greater Accra'=>'Greater Accra','Bono East'=>'Bono East','Bono'=>'Bono','Brong-Ahafo'=>'Brong-Ahafo','Ashanti'=>'Ashanti','Ahafo'=>'Ahafo','User&#8217;s WooCommerce purchased downloads data.'=>'Kupljeni preuzeti podaci korisnika&#8217; WooCommerce-a.','User&#8217;s WooCommerce orders data.'=>'Narudžbe korisnika&#8217; WooCommerce-a.','User&#8217;s WooCommerce customer data.'=>'Podaci korisnika&#8217; WooCommerce-a.','%s() was called before the Action Scheduler data store was initialized'=>'%s() je pozvan prije nego je planer akcija inicijaliziran','Your store\'s uploads directory is <a href="%1$s">browsable via the web</a>. We strongly recommend <a href="%2$s">configuring your web server to prevent directory indexing</a>.'=>'Direktorij za prijenos vaše trgovine <a href="%1$s"> može se pregledavati putem interneta </a>. Savjetujemo <a href="%2$s"> konfi