be activated.'=>'Dodatak nije moguće aktivirati.','Personalize homepage'=>'Personaliziraj početnu stranicu','Personalize your store\'s homepage'=>'Personaliziraj početnu stranicu svoje trgovine','The homepage is one of the most important entry points in your store. When done right it can lead to higher conversions and engagement. Don\'t forget to personalize the homepage that we created for your store during the onboarding.'=>'Početna stranica jedna je od najvažnijih ulaznih točaka u vašoj trgovini. Ako se napravi ispravno, to može dovesti do većih konverzija i angažmana. Ne zaboravite personalizirati početnu stranicu koju smo stvorili za vašu trgovinu tijekom ukrcaja.','There was an error communicating with the WooPayments plugin.'=>'Došlo je do greške prilikom komunikacije s dodatkom WooPayments.','Securely accept credit and debit cards on your site. Manage transactions without leaving your WordPress dashboard. Only with <strong>WooPayments</strong>.'=>'Sigurno prihvaćajte kreditne i debitne kartice na svojoj web lokaciji. Upravljajte transakcijama bez napuštanja svoje WordPress nadzorne ploče. Samo uz <strong> WooPayments </strong>.','Try the new way to get paid'=>'Isprobajte novi način plaćanja','It appears one or more database tables were missing. Attempting to re-create the missing table(s).'=>'Izgleda da su nedostajale jedna ili više tablica baze podataka. Pokušaj ponovnog stvaranja nedostajuće tablice.','Your store is configured to serve digital products using "Redirect only" method. This method is deprecated, <a href="%s">please switch to a different method instead.</a><br><em>If you use a remote server for downloadable files (such as Google Drive, Dropbox, Amazon S3), you may optionally wish to "allow using redirects as a last resort". Enabling that and/or selecting any of the other options will make this notice go away.</em>'=>'Vaša je trgovina konfigurirana za posluživanje digitalnih proizvoda pomoću metode "Samo preusmjeravanje". Ova metoda je zastarjela, <a href="%s"> umjesto toga prebacite se na drugu metodu.</a> <br><em>Ako koristite udaljeni poslužitelj za datoteke za preuzimanje (kao što su Google Drive, Dropbox, Amazon S3), možete opcionalno "dozvoliti korištenje preusmjeravanja kao zadnju opciju". Odabirom te opcije i/ili bilo koju druge opcije ova obavijest biti će uklonjena. </em>','Mobile app'=>'Mobilna aplikacija','Get started'=>'Započni','Choose theme'=>'Odaberite temu','Send targeted campaigns, recover abandoned carts and much more with Mailchimp.'=>'Pošaljite ciljane kampanje, oporavite napuštene košarice i još mnogo toga pomoću Mailchimpa.','Securely accept credit and debit cards with one low rate, no surprise fees (custom rates available). Sell online and in store and track sales and inventory in one place.'=>'Sigurno prihvaćajte kreditne i debitne kartice s jednom niskom stopom, bez skrivenih naknada (dostupne prilagođene stope). Prodajte online i u trgovini i pratite prodaju i zalihe na jednom mjestu.','Choose the payment that you want, pay now, pay later or slice it. No credit card numbers, no passwords, no worries.'=>'Odaberite plaćanje koje želite, platite sada, platite kasnije ili na rate. Bez brojeva kreditnih kartica, bez lozinki, bez brige.','Accept debit and credit cards in 135+ currencies, methods such as Alipay, and one-touch checkout with Apple Pay.'=>'Prihvatite debitne i kreditne kartice u 135+ valuta, metode kao što su Alipay i naplata jednim dodirom pomoću Apple Paya.','Set up payments'=>'Podesite naplatu','Store connected successfully.'=>'Trgovina je uspješno povezana.','Import your products'=>'Uvezite proizvode','Close dialog'=>'Zatvori dijalog','Dismiss this notice'=>'Zatvori ovu obavijest ','Average order value'=>'Prosječna vrijednost narudžbe','🎉 Congrats on adding your first product!'=>'🎉 Čestitke na dodavanju vašeg prvog proizvoda!','Amount'=>'Iznos','Customer type'=>'Vrsta kupca','Gross sales'=>'Bruto prodaja','CBD and other hemp-derived products'=>'CBD i ostali proizvodi d