te trebati ručno povratiti zaliku artikla.','Millimeters'=>'milimetara','Meters'=>'metara','Centimeters'=>'centimetara','Ounces'=>'unci','Pounds'=>'funti','Grams'=>'grama','Kilograms'=>'kilograma','Item moved down'=>'Stavka pomaknuta naniže','Item moved up'=>'Stavka pomaknuta naviše','%d API key permanently revoked.'=>'%d API ključ je trajno opozvan.' . "\0" . '%d API ključa su trajno opozvana.' . "\0" . '%d API ključeva je trajno opozvano.','Apartment, suite, unit, etc.'=>'Kat, broj stana ili sl.','Cannot set attributes due to invalid parent product.'=>'Nije moguće postaviti atribute zbog neispravnog matičnog proizvoda.','This action cannot be reversed. Are you sure you wish to erase personal data from the selected orders?'=>'Ova akcija se ne može poništiti. Jeste li sigurni da želite obrisati podatke iz odabranih narudžbi?','shipping packagesShipping %d'=>'Dostava %d','Shipping Address'=>'Adresa za dostavu','Billing Address'=>'Adresa za naplatu','Shipping Address 1'=>'Adresa za dostavu 1','Billing Address 1'=>'Adresa za naplatu 1','Payer last name'=>'Prezime platitelja','Payer first name'=>'Ime platitelja','MySQL version string.'=>'MySQL version string.','Your CSV needs to include columns in a specific order. %1$sClick here to download a sample%2$s.'=>'Vaš CSV treba sadržavati stupce u određenom poretku. %1$s Kliknite ovdje kako biste preuzeli ogledni uzorak %2$s.','Payer PayPal address'=>'PayPal adresa platitelja','This will be how your name will be displayed in the account section and in reviews'=>'Ovako će vaše ime biti prikazano u odjeljku "Moj račun" i u recenzijama','United States (US) dollar'=>'United States (US) dollar','PayPal allows us to send one address. If you are using PayPal for shipping labels you may prefer to send the shipping address rather than billing. Turning this option off may prevent PayPal Seller protection from applying.'=>'PayPal omogućuje slanje jedne adrese. Ako upotrebljavate PayPal za otpremnice, možda biste radije poslali adresu za dostavu, a ne za naplatu. Isključivanje ove opcije može spriječiti primjenu PayPal zaštite prodavatelja.','terms and conditions'=>'uvjetima korištenja i odredbama','privacy policy'=>'pravilima privatnosti','eCheck ending in %1$s'=>'eCheck završava na %1$s','PayPal Standard redirects customers to PayPal to enter their payment information.'=>'PayPal Standard preusmjerava korisnike na PayPal da unesu svoje podatke o plaćanju.','Other locations'=>'Druge lokacije','%1$s &ndash; %2$s'=>'%1$s &ndash; %2$s','%1$s (#%2$s)'=>'%1$s (#%2$s)','Any &quot;%1$s&quot; method'=>'Bilo koja &quot;%1$s&quot; metoda','Take payments in person via checks. This offline gateway can also be useful to test purchases.'=>'Plaćanja putem čekova. Ovaj izvanmrežni gateway također može biti koristan za testiranje kupnje.','Account details:'=>'Detalji računa:','Comma-separated list of search stopwords in your languageabout,an,are,as,at,be,by,com,for,from,how,in,is,it,of,on,or,that,the,this,to,was,what,when,where,who,will,with,www'=>'about,an,are,as,at,be,by,com,for,from,how,in,is,it,of,on,or,that,the,this,to,was,what,when,where,who,will,with,www','Optionally add some text for the terms checkbox that customers must accept.'=>'Po želji dodajte neki tekst za potvrdni okvir za uvjete korištenja koje korisnici moraju prihvatiti.','%s page'=>'%s stranica','No page set'=>'Nije postavljena stranica','Highlight required fields with an asterisk'=>'Označi obavezna polja zvjezdicom','Required'=>'Obavezno','%s field'=>'polje %s','These options let you change the appearance of the WooCommerce checkout.'=>'Ove vam opcije omogućuju promjenu izgleda WooCommerce stranice naplate.','Please see the <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">PayPal Privacy Policy</a> for more details.'=>'Više pojedinosti potražite u <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full"> Pravilima o privatnosti usluge PayPal </a>.','We accept payments through PayPal. When processing payments, some of your data will be passed to PayPal, including information required to process or support the payment, such as the purchase total and billing information.'=>'Prihvaćamo plaćanja putem PayPala. Prilikom obrade uplata, neki će podaci biti proslijeđeni PayPalu, uključujući informacije potrebne za obradu ili podršku plaćanja, kao što su ukupni iznos kupnje i podaci o naplati.','I have read and agree to the website %s'=>'Pročitao/la sam i slažem se s %s web-stranice.','Take payments in person via BACS. More commonly known as direct bank/wire transfer.'=>'Primajte uplate putem transakcijskog računa','In this subsection you should list which third party payment processors you’re using to take payments on your store since these may handle customer data. We’ve included PayPal as an example, but you should remove this if you’re not using PayPal.'=>'U ovom pododjeljku trebate navesti procesore za plaćanje treće strane koje koristite za plaćanje u vašoj trgovini, jer se ti podaci mogu obrađivati. Primjerice, uključili smo PayPal, ali to biste trebali ukloniti ako ga ne upotrebljavate.','We share information with third parties who help us provide our orders and store services to you; for example --'=>'Dijelimo informacije s trećim stranama koje nam pomažu pružati narudžbe i pohranjivati usluge; na primjer --','In this section you should list who you’re sharing data with, and for what purpose. This could include, but may not be limited to, analytics, marketing, payment gateways, shipping providers, and third party embeds.'=>'U ovom odjeljku navedite s kim dijelite podatke i za koju svrhu. To može uključivati, ali ne mora biti ograničeno na, analitiku, marketing, gatewaye za plaćanje, davatelje usluga isporuke i ugrađivanje od trećih strana (embeds).','What we share with others'=>'Što dijelimo s drugima','Our team members have access to this information to help fulfill orders, process refunds and support you.'=>'Članovi našeg tima imaju pristup ovim informacijama kako bi ispunili narudžbe, obradili povrate i pružali korisničku podršku.','Customer information like your name, email address, and billing and shipping information.'=>'Informacije o klijentima kao što su: vaše ime, adresa e-pošte i informacije o naplati i dostavi.','Order information like what was purchased, when it was purchased and where it should be sent, and'=>'Informacije o narudžbi poput onoga što je kupljeno, kada je kupljeno, gdje treba poslati, i','Members of our team have access to the information you provide us. For example, both Administrators and Shop Managers can access:'=>'Članovi našeg tima imaju pristup informacijama koje nam dajete. Na primjer, administratori i upravitelji dućana mogu pristupiti:','Who on our team has access'=>'Tko iz našeg tima ima pristup','We will also store comments or reviews, if you choose to leave them.'=>'Također ćemo pohraniti komentare ili recenzije, ako ih odlučite ostaviti.','We generally store information about you for as long as we need the information for the purposes for which we collect and use it, and we are not legally required to continue to keep it. For example, we will store order information for XXX years for tax and accounting purposes. This includes your name, email address and billing and shipping addresses.'=>'Obično pohranjujemo informacije o vama dok god trebamo vaše podatke u svrhe za koje ih prikupljamo i upotrebljavamo, a nismo više zakonski obvezni da ih čuvamo. Na primjer, podatke o narudžbi čuvamo 10 godina za porezne i računovodstvene svrhe. To uključuje vaše ime, adresu e-pošte i adrese za naplatu i dostavu.','If you create an account, we will store your name, address, email and phone number, which will be used to populate the checkout for future orders.'=>'Ako izradite račun, pohranit ćemo vaše ime, adresu, email adresu i telefonski broj, koji će se upotrijebiti za popunjavanje polja naplate prilikom buduće narudžbe.','Send you marketing messages, if you choose to receive them'=>'Slanje marketinških poruka, ako ih odlučite primati','Improve our store offerings'=>'Poboljšajte ponudu vaše trgovine','Comply with any legal obligations we have, such as calculating taxes'=>'Pridržavajte se svih zakonskih obveza koje imate, poput izračuna poreza','Set up your account for our store'=>'Postavite korisnički račun za našu trgovinu','Respond to your requests, including refunds and complaints'=>'Odgovorite na zahtjeve, uključujući povrate i prigovore','Send you information about your account and order'=>'Slanje informacija o vašem računu i narudžbi','When you purchase from us, we’ll ask you to provide information including your name, billing address, shipping address, email address, phone number, credit card/payment details and optional account information like username and password. We’ll use this information for purposes, such as, to:'=>'Kada kupujete od nas, od vas ćemo tražiti da dajete podatke, uključujući vaše ime, adresu za naplatu, adresu za dostavu, adresu e-pošte, telefonski broj, podatke o plaćanju i opcionalne podatke o računu kao što su korisničko ime i zaporka. Koristit ćemo te podatke za svrhe, kao što su:','Process payments and prevent fraud'=>'Obrada plaćanja i sprječavanje prijevare','Note: you may want to further detail your cookie policy, and link to that section from here.'=>'Napomena: preporučujemo dodavanje dodatnih pojedinosti u pravila o kolačićima i povezivanje tog odjeljka odavde.','We’ll also use cookies to keep track of cart contents while you’re browsing our site.'=>'Također ćemo koristiti kolačiće kako bismo pratili sadržaj košarice dok pregledavate našu web stranicu','Shipping address: we’ll ask you to enter this so we can, for instance, estimate shipping before you place an order, and send you the order!'=>'Adresa za dostavu: zatražit ćemo od vas da unesete ovo kako bismo, primjerice, mogli procijeniti cijenu/opciju dostave prije slanja narudžbe i/ili poslati vam narudžbu!','Location, IP address and browser type: we’ll use this for purposes like estimating taxes and shipping'=>'Lokacija, IP adresa i vrsta preglednika: koristit ćemo to za svrhe kao što su procjena poreza i dostave','Products you’ve viewed: we’ll use this to, for example, show you products you’ve recently viewed'=>'Proizvodi koje ste pogledali: koristit ćemo ovo da bi, na primjer, prikazali proizvode koje ste nedavno pogledali.','While you visit our site, we’ll track:'=>'Dok pregledavate našu web stranicu, pratit ćemo sljedeće:','What we collect and store'=>'Što prikupljamo i pohranjujemo','We collect information about you during the checkout process on our store.'=>'Prikupljamo informacije o vama tijekom postupka naplate na našoj trgovini.','This sample language includes the basics around what personal data your store may be collecting, storing and sharing, as well as who may have access to that data. Depending on what settings are enabled and which additional plugins are used, the specific information shared by your store will vary. We recommend consulting with a lawyer when deciding what information to disclose on your privacy policy.'=>'Ovaj primjer teksta uključuje osnove oko toga koje osobne podatke vaša trgovina može prikupljati, pohranjivati i dijeliti, kao i tko može imati pristup tim podacima. Ovisno o tome koje su postavke omogućene i koje dodatne dodatke upotrebljavate, određene informacije koje će dijeliti vaša trgovina razlikuju se. Preporučujemo da se savjetujete s odvjetnikom prilikom odlučivanja o informacijama koje ćete otkriti u vašim pravilima o privatnosti.','Browser User Agent'=>'User Agent preglednika','Items Purchased'=>'Kupljene stavke','Access granted'=>'Pristup odobren','Order Number'=>'Broj narudžbe','Download count'=>'Broj preuzimanja','Token'=>'Token','Payment Tokens'=>'Tokeni za plaćanje','User email'=>'Korisnička e-pošta','Personal data removed.'=>'Osobni podaci uklonjeni.','Shipping Postal/Zip Code'=>'Poštanski broj','Shipping City'=>'Grad za isporuku','Shipping Company'=>'Dostava - poduzeće','Shipping Last Name'=>'Prezime za dostavu','Shipping First Name'=>'Ime za dostavu','Phone Number'=>'Broj telefona','Billing State'=>'Regija/županija naplate','Billing Company'=>'Naplata - poduzeće','Billing First Name'=>'Naplata - ime','Billing Last Name'=>'Naplata - prezime','Billing City'=>'Naplata - grad','Billing Postal/Zip Code'=>'Naplata - poštanski broj ','display name%1$s %2$s'=>'%1$s %2$s','Please read and accept the terms and conditions to proceed with your order.'=>'Pročitajte i prihvatite uvjete korištenja i odredbe kako biste nastavili s narudžbom.','Unserializing instances of this class is forbidden.'=>'Unserializing instances of this class is forbidden.','Cloning is forbidden.'=>'Kloniranje je zabranjeno.','Deleted all active sessions, and %d saved carts.'=>'Izbrisane su sve aktivne sesije i %d spremljenih košarica.','This tool will delete all customer session data from the database, including current carts and saved carts in the database.'=>'Ovaj alat će izbrisati sve podatke o sesijama korisnika iz baze podataka, uključujući trenutne košarice i košarice spremljene u bazi podataka.','If the payment was refunded via the API.'=>'Ako je uplata refundirana putem API-ja.','Order total formatted for locale'=>'Ukupan iznos narudžbe formatiran lokalno.','%1$s has been removed from your cart because it has since been modified. You can add it back to your cart <a href="%2$s">here</a>.'=>'%1$s je uklonjen iz vaše košarice jer je u međuvremenu izmijenjen. Proizvod možete dodati u košaricu <a href="%2$s"> ovdje</a>.','Shipping State'=>'Regija/Županija za dostavu','Download ID'=>'ID preuzimanja','Customer Data'=>'Podaci kupca','Error during status transition.'=>'Pogreška prilikom prijelaza statusa.','Update status event failed.'=>'Ažuriranje statusa događaja nije uspjelo.','Payment complete event failed.'=>'Payment complete event failed.','optional'=>'neobavezno','Display name'=>'Ime za prikaz','Display name cannot be changed to email address due to privacy concern.'=>'Ime za prikaz ne može se mijenjati na adresu e-pošte zbog privatnosti.','Name of the customer for the order'=>'Ime kupca za narudžbu','URL to edit the order'=>'URL za uređivanje narudžbe','Blog id of the record on the multisite.'=>'Blog ID zapisa na multisiteu.','Access to Purchased Downloads'=>'Pristup kupljenim preuzimanjima','Purchased Downloads'=>'Kupljena preuzimanja','Removed payment token "%d"'=>'Uklonjen token plaćanja "%d"','Customer download permissions have been retained.'=>'Dozvole kupca za preuzimanje su zadržane.','Removed access to downloadable files.'=>'Uklonjen pristup datotekama za preuzimanje.','Personal data within order %s has been retained.'=>'Osobni podaci unutar narudžbe %s su zadržani.','Removed personal data from order %s.'=>'Uklonjeni su osobni podaci iz narudžbe %s.','Removed customer "%s"'=>'Uklonjen kupac "%s"','User roleShop manager'=>'Voditelj trgovine','User roleCustomer'=>'Kupac','%d permissions deleted'=>'%d dopuštenja su izbrisana','This tool will delete expired download permissions and permissions with 0 remaining downloads.'=>'Ovaj alat će izbrisati istekle dozvole za preuzimanje i dozvole s 0 preostalih preuzimanjima.','Clean up download permissions'=>'Očisti dozvole za preuzimanje','Used-up download permissions'=>'Iskorištene dozvole za preuzimanje','Limit result set to products with a specific attribute. Use the taxonomy name/attribute slug.'=>'Ograniči rezultate postavljene na proizvode s određenim atributom. Upotrijebite naziv taksonomije / atribut.','Unable to create order.'=>'Nije moguće kreirati narudžbu.','Your store does not appear to be using a secure connection. We highly recommend serving your entire website over an HTTPS connection to help keep customer data secure. <a href="%s">Learn more here.</a>'=>'Izgleda da vaša trgovina ne koristi sigurnu vezu. Preporučujemo da poslužite cijelu web-lokaciju putem HTTPS veze kako biste zaštitili podatke klijenata. <a href="%s"> Saznajte više ovdje.</a>','WooCommerce pages'=>'WooCommerce stranice','WooCommerce database version'=>'Inačica WooCommerce baze podataka','Settings tab labelPayments'=>'Plaćanja','Enable coupons'=>'Omogući korištenje kupona','Rates will be configurable and taxes will be calculated during checkout.'=>'Stope i porezi će biti izračunati tijekom naplate.','Enable tax rates and calculations'=>'Uključi stope poreza i izračune','Account endpoints'=>'Krajnje točke računa','Secure checkout'=>'Sigurno plaćanje','Legacy API'=>'Naslijeđeni (legacy) API','Displays whether or not WordPress is using an external object cache.'=>'Prikazuje hoće li WordPress koristiti vanjski object cache.','External object cache'=>'Vanjski object cache','WordPress cron'=>'WordPress cron','WordPress debug mode'=>'WordPress debug mode','WordPress memory limit'=>'WordPress memory limit','WordPress multisite'=>'WordPress multisite','%1$s - There is a newer version of WordPress available (%2$s)'=>'%1$s - Dostupna je novija verzija WordPressa (%2$s)','Retain completed orders'=>'Zadrži dovršene narudžbe','Retain completed orders for a specified duration before anonymizing the personal data within them.'=>'Zadrži izvršene narudžbe u određenom trajanju prije anonimizacije osobnih podataka unutar njih.','Retain cancelled orders'=>'Zadrži otkazane narudžbe','Failed orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'Neuspješne narudžbe nisu plaćene i možda ih je kupac napustio. One će biti premještene u smeće nakon navedenog trajanja.','Retain failed orders'=>'Zadrži neuspjele narudžbe','Pending orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'Narudžbe na čekanju neplaćene su i možda ih je klijent napustio. One će biti premještene u smeće nakon navedenog trajanja.','WooCommerce version'=>'WooCommerce inačica','Manage'=>'Upravljanje','WordPress version'=>'WordPress inačica','Cancelled orders are unpaid and may have been cancelled by the store owner or customer. They will be trashed after the specified duration.'=>'Otkazane narudžbe su neplaćene i možda su otkazane od strane vlasnika trgovine ili korisnika. One će biti premještene u smeće nakon navedenog perioda.','Optionally add some text about your store privacy policy to show during checkout.'=>'Po želji dodajte neki tekst na stranici naplate o pravilima o privatnosti trgovine.','Checkout privacy policy'=>'Pravila o privatnosti na stranici naplate','Optionally add some text about your store privacy policy to show on account registration forms.'=>'Po želji dodajte tekst o pravilima o privatnosti trgovine u obrasce za prijavu/registraciju računa.','Registration privacy policy'=>'Pravila o privatnosti za registraciju','privacy page'=>'Stranica o privatnosti','Privacy policy'=>'Pravila o privatnosti','Accounts &amp; Privacy'=>'Računi i Privatnost','Your personal data will be used to support your experience throughout this website, to manage access to your account, and for other purposes described in our %s.'=>'Vaši će se osobni podaci koristiti za podršku vašem iskustvu na ovoj web stranici, za upravljanje pristupom vašem računu i za druge svrhe opisane u našim %s.','Filter by registered customer'=>'Filtriranje po registriranom kupcu','Remove personal data'=>'Uklonite osobne podatke','Use previous column mapping preferences?'=>'Upotrijebite prethodne postavke mapiranja stupaca?','Retain pending orders '=>'Zadrži narudžbe na čekanju','Inactive accounts are those which have not logged in, or placed an order, for the specified duration. They will be deleted. Any orders will be converted into guest orders.'=>'Neaktivni računi su oni koji se nisu prijavili ili ostvarili kupovinu u navedenom trajanje. Takvi računi će biti izbrisani. Sve narudžbe ostvarene preko neaktivnih računa će biti pretvorene u narudžbe gostiju.','Retain inactive accounts '=>'Zadrži neaktivne račune','Choose how long to retain personal data when it\'s no longer needed for processing. Leave the following options blank to retain this data indefinitely.'=>'Odaberite koliko dugo želite zadržati osobne podatke kada više nisu potrebni za obradu. Ostavite sljedeće opcije prazne da biste zadržali te podatke na neodređeno vrijeme.','Personal data retention'=>'Zadržavanje osobnih podataka','Account erasure requests'=>'Zahtjevi za brisanje računa','This section controls the display of your website privacy policy. The privacy notices below will not show up unless a %s is set.'=>'Ovaj odjeljak kontrolira prikaz pravila o privatnosti vaše web stranice. Niže navedene obavijesti o privatnosti neće se prikazivati osim ako je %s već postavljena.','Allowed emails'=>'Dopuštene adrese e-pošte','List of allowed billing emails to check against when an order is placed. Separate email addresses with commas. You can also use an asterisk (*) to match parts of an email. For example "*@gmail.com" would match all gmail addresses.'=>'Popis dopuštenih adresa e-pošte za provjeru e-pošte za naplatu klijenta prilikom naručivanja. Odvojite adrese e-pošte zarezima. Također možete koristiti zvjezdicu (*) da biste podudarali dijelove e-pošte. Na primjer "*@gmail.com" bi odgovarao svim gmail adresama.','Your personal data will be used to process your order, support your experience throughout this website, and for other purposes described in our %s.'=>'Vaši osobni podaci biti će korišteni za obradu vaše narudžbe, podršku vašemu iskustvu na ovoj internetskoj stranici te za druge svrhe opisane u našoj %s.','Removed personal data from %s order.'=>'Uklonjeni osobni podaci iz %s narudžbe.' . "\0" . 'Uklonjeni osobni podaci iz %s narudžbe.' . "\0" . 'Uklonjeni osobni podaci iz %s narudžbi.','View &amp; Customize'=>'Prikaži &amp; Prilagodi','Review Settings'=>'Postavke recenzija','Visit Dashboard'=>'Posjeti nadzornu ploču','You can also:'=>'Također možete:','You\'re ready to add products to your store.'=>'Spremni ste za dodavanje proizvoda u trgovinu.','Create some products'=>'Kreirajte neke proizvo