ept them when checking out.'=>'Ako definirate "Uvjete korištenja" kupac će biti upitan da li ih prihvaća prije plaćanja.','This option lets you limit which countries you are willing to sell to.'=>'Ova opcija vam omogućuje da odredite u koje zemlje želite prodavati.','Specific Countries'=>'Određene države','Shop base address'=>'Osnovna adresa trgovine','Geolocate'=>'Geolokacija','Geolocate (with page caching support)'=>'Geolocate (sa stranicom za podršku kaširanja)','This is a demo store for testing purposes &mdash; no orders shall be fulfilled.'=>'Ovo je demo prodavaonica samo za testiranje &mdash; narudžbe neće biti provedene.','Currency'=>'Valuta','This controls what currency prices are listed at in the catalog and which currency gateways will take payments in.'=>'Ovdje kontrolirate koje valutu cijena u katalogu i u kojoj valuti će metode plaćanja vršiti naplatu.','This controls the position of the currency symbol.'=>'Ovo kontrolira poziciju simbola valute.','This sets the thousand separator of displayed prices.'=>'Ovo postavlja sparator tisućica na prikazanim cijenama.','This sets the decimal separator of displayed prices.'=>'Ovo postavlja decimalni sparator prikazanih cijena.','This sets the number of decimal points shown in displayed prices.'=>'Ovo postavlja broj ','Integration'=>'Integracija','This sets the base page of your shop - this is where your product archive will be.'=>'Ovime postavljate osnovnu stranicu vaše trgovine - ovdje će biti arhiva vaših proizvoda.','Show products'=>'Prikaži proizvode','Show subcategories'=>'Prikaži pod-kategorije','Default sorting (custom ordering + name)'=>'Osnovno razvrstavanje (prilagođeno razvrstavanje + ime)','Popularity (sales)'=>'Popularnost (prodaja)','Sort by most recent'=>'Sortiraj po najnovije','Sort by price (asc)'=>'Sortiraj po cijeni (uzlazno)','Sort by price (desc)'=>'Sortiraj po cijeni (silazno)','Redirect to the cart page after successful addition'=>'Preusmjeri na košaricu nakon uspješnog dodavanja proizvoda'